import Rebase from "re-base";
import firebase from "firebase";

const firebaseApp = firebase.initializeApp({
  apiKey: "AIzaSyBqFrGMUNz2nsvyi3b0r5t9aPoSjw3atU8",
  authDomain: "menu-whattheduck.firebaseapp.com",
  databaseURL: "https://menu-whattheduck.firebaseio.com"
});

const base = Rebase.createClass(firebaseApp.database());
export { firebaseApp };
export default base;
